Step-by-step reasoning:

1. Key psychological mechanisms involved:
 • Monetary gain: Responders care about the absolute amount of money offered.
 • Fairness/inequity aversion: Responders compare the offered amount to a fair share computed from their own and the opponent’s token findings.
 • Baseline preferences: There may be an inherent bias or intercept affecting the perceived utility.

2. Interaction of these mechanisms:
 • The offered payout (accepted_amount) contributes positively.
 • A fairness norm is computed by using the tokens information: fair_share = (token_self / (token_self + token_opp)) * combined_earning.
 • When the offered amount is below this fair share, a penalty is incurred proportional to the deviation.
 • A multiplicative factor (monetary sensitivity, λ) scales the offered amount, and an intercept (b) shifts baseline utility.

3. Mathematical form:
 • We use a linear combination for the monetary component and subtract a penalty (activated when the payout is lower than the fair share). In formula, it is:
  U = b + λ · accepted_amount − α · max(fair_share − accepted_amount, 0).

4. Parameters needed:
 • b: baseline utility (bias/intercept).
 • λ: monetary sensitivity (how strongly the monetary amount influences utility).
 • α: fairness sensitivity (i.e. degree of inequity aversion when the offer is less than the computed fair share).

5. Mapping to observed behavior:
 • accepted_amount comes directly from the dataset.
 • Tokens (token_self and token_opp) and combined_earning are used to compute an individualized reference fair_share.
 • Only responder trials (trial_role = 1) are modeled.
 • The model output is the utility of accepting an offer, which can be later used in an action selection mechanism.
 • All learnable parameters (b, λ, α) are given generous finite bounds.

Below is the formal specification.

<MODEL>
fair_share = (token_self / (token_self + token_opp)) * combined_earning
